  const fetchProducts = () => {
    fetch('https://dummyjson.com/products/1', {
      method: 'get',
    })
      .then((res) => res.json())
      .then((oData) => {
        console.log(oData);
      });
  };

  return (
    <div className="App">
      <header className="App-header">Learn React</header>
    </div>
  );
}

export default App;
